import React from "react";
import CarouselComponent from "./(utils)/Carousel";

const UpComing = () => {
  return (
    <div className="flex items-start p-10 flex-col gap-10">
      <div className="text-xl ">UpComing Titles</div>
      <div className="p-10">
        <CarouselComponent />
      </div>
    </div>
  );
};

export default UpComing;
